import React from 'react';
import logo from '../assets/logo.png';


export default function Header(props) {
  return (
    <header className="header">
      <div className="row">
      <h1 className="col-lg-10">{props.ime}</h1>
      <img className="col-lg-2 img" src={logo} width="20"/>
      </div>
      <div className="row">
      <h1 className="col-lg-10">{props.ime}</h1>
      <img className="col-lg-2 img" src={logo} width="20"/>
      </div>
      <p>{props.slogan}</p>
      
    </header>
  )
}
